// 스타일 컴포넌트 정의
const Container = styled.div`
  position: relative;
  margin: auto;
  margin-bottom: 100px;
  margin-top: 30px;
  background-color: #f9f9f9; 
  border-radius: 10px;
  height: auto; 
  width: 90%;
  overflow: hidden;
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1), 0 10px 20px rgba(0, 0, 0, 0.2);
  padding: 20px;
  @media screen and (max-width: 700px) {
    padding: 10px;
  }
`;

const Slider = styled(motion.div)`
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  gap: 20px;
  width: 100%;
  text-align: center;
  @media screen and (max-width: 700px) {
    grid-template-columns: repeat(2, 1fr);
    gap: 10px;
  }
`;

const PlaceBox = styled(motion.div)`
  position: relative;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const Rating = styled.div`
  position: absolute;
  font-size: 18px;
  top: 10px; 
  right: 10px;
  background-color: rgba(0, 0, 0, 0.7); 
  border-radius: 50%;
  padding: 10px;
  color: white;
`;

const PlaceImg = styled(motion.img)`
  width: 100%; 
  height: auto;
  background-size: cover;
  background-position: center center;
  border-radius: 10px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  cursor: pointer;
  @media screen and (max-width: 700px) {
    height: 170px;
  }
`;

const PlaceTitle = styled(motion.div)`
  margin-top: 10px;
  color: #333;
  font-size: 18px;
  font-weight: bold;
  text-align: center;
`;

const PlaceDesc = styled.div`
  color: #666;
  font-size: 14px;
  text-align: center;
  margin-top: 5px;
`;

const NextBtn = styled.img`
  width: 30px;
  position: absolute;
  right: 10px; 
  top: 50%;
  cursor: pointer;
  transform: translateY(-50%);
`;

const PrevBtn = styled.img`
  width: 30px;
  position: absolute;
  left: 10px;
  top: 50%;
  cursor: pointer;
  transform: translateY(-50%);
`;

// 슬라이더 애니메이션 변수
const SliderVar = {
    hidden: (isBack) => ({
        x: isBack ? -window.outerWidth + (window.outerWidth / 10) : window.outerWidth - (window.outerWidth / 10),
    }),
    visible: {
        x: 0,
    },
    exit: (isBack) => ({
        x: isBack ? window.outerWidth - (window.outerWidth / 10) : -window.outerWidth + (window.outerWidth / 10),
    }),
};

// 메인 컴포넌트
export default function WholePlace() {
    const [Index, setIndex] = useState(0);
    const [back, setBack] = useState(false);
    const [leaving, setLeaving] = useState(false);
    const [restaurantData, setRestaurantData] = useState([]);
    const navigate = useNavigate();
    
    const nextPlease = async () => {
        if (leaving) return;
        toggleLeaving();
        await setBack(false);
        setIndex((prev) => (prev === 16 ? 0 : prev + 4));
    }
    const prevPlease = async () => {
        if (leaving) return;
        toggleLeaving();
        await setBack(true);
        setIndex((prev) => (prev === 0 ? 16 : prev - 4));
    }
    const toggleLeaving = () => setLeaving((cur) => !cur);

    const handleImageClick = async (restaurantId) => {
        try {
            navigate(`/place/${restaurantId}`);
        } catch (error) {
            console.error('Error fetching restaurantId:', error);
        }
    };

    useEffect(() => {
        async function fetchRestaurant() {
            try {
                const response = await axios.get('/restaurantData');
                const shuffledImages = response.data.restaurantData.sort(() => Math.random() - 0.5);
                setRestaurantData(shuffledImages);
            } catch (error) {
                console.error('Error fetching images:', error);
            }
        }

        fetchRestaurant();
    }, []);

    return (
        <Container>
            <AnimatePresence initial={false} onExitComplete={toggleLeaving}>
                <Slider
                    custom={back}
                    variants={SliderVar}
                    initial="hidden"
                    animate="visible"
                    exit="exit"
                    transition={{ type: "tween", duration: 1 }}
                    key={Index}
                >
                    {restaurantData.slice(Index, Index + 4).map(
                        (restaurant, idx) => (
                            <PlaceBox whileHover={{ scale: 1.1 }} key={idx}>
                                <PlaceImg 
                                    src={restaurant.img} 
                                    alt={restaurant.restaurantName} 
                                    onClick={() => handleImageClick(restaurant.restaurantId)} 
                                />
                                <Rating><span style={{ color: "rgba(30, 144, 255,1.0)" }}>&#9733;</span> 3.5</Rating>
                                <PlaceTitle 
                                    initial={{ scale: 0 }} 
                                    animate={{ scale: 1 }} 
                                    transition={{ delay: 0.1 }}
                                >
                                    {restaurant.restaurantName}
                                </PlaceTitle>
                            </PlaceBox>
                        )
                    )}
                </Slider>
                <PrevBtn src={process.env.PUBLIC_URL + "/back.png"} onClick={prevPlease} />
                <NextBtn src={process.env.PUBLIC_URL + "/next.png"} onClick={nextPlease} />
            </AnimatePresence>
        </Container>
    )
}
